import React from 'react';
import { Link } from 'react-router-dom';
import Map from '/Users/vincentman/Desktop/the-cerulean-project/src/frontend/Components/Map.js';

export default function TrainerCover(props) {
    let url = require(`../../common/images/profile-img/${props.id}.jpg`);
    // let mapUrl = `https://www.google.com/maps/embed/v1/search?q=${props.map}&key=AIzaSyA2mnrO-E4fx-eXWvqFrYbsVMxeF8le030`
    return (
        <Link to={`/${props.id}`} className='profile-item'>
            <img
                src={url}
                alt={props.lastname}
                className='profile-img'
            />
            <Map title={props.address} map={props.map}/>

            <h2 className='name'>{props.firstname} {props.lastname}</h2>
        </Link>
    );
}

